export default function modified(data) {
    let res = [];
    for (img of data) {
        let image = img.substring(1, img.length-1);
        const number = img.match(/\d+/)[0];
        image = img.replace(number, '') + '/' + number + '.png';
        res.append(img);
    }

    return res;
}
